import Expense from "./components/Expense/ExpenseItem";
import { expenses } from "./services/expenses";
function App() {

  return (
    <div>
      <h2>Let's get started!</h2>
      {expenses.map(expense => (
        <Expense key={expense.id} data={expense} />
      ))}
    </div>
  );
}

export default App;
